import { useNavigate } from 'react-router-dom';
import logo from "../../Assets/logo.png"
import './Navbar.css';
import {Link} from "react-router-dom";

function Navbar(){
    const navigate = useNavigate();
    return <div className='Navbar'>
        <Link to="/">
            <section className='sectionHeading'>
                <h2><span className="h2Nav"> book</span><img className="logo" src={logo} alt={logo}></img><span className="h2Nav">show</span></h2>
            </section>
        </Link>
        <input className='NavSearch' type='text' placeholder='Search for Movies'/>
        <button className='Button' onClick={() => navigate("/Login")}>Log In</button>
        <button className='NavButton' onClick={() => navigate("/RegisterUser")}>Register</button>
    </div>
}

export default Navbar;
